Overview: A beautiful live wallpaper backdrop of a sunset ridgeline and silhouetted trees.


A beautiful live wallpaper of silhouetted shapes before a dramatic sunset sky. Select from a ridgeline with trees, windmills, or city! This full version has a settings screen with controls for cloud speed, time of day shifting, sky color, and more!

TO USE: Home-&gt;Long Press-&gt;Live Wallpapers


